import cv2
from keras.models import load_model
import numpy as np
from collections import deque
import os

model = load_model('models/QuickDraw.h5')

def keras_predict(model, image):
    processed = keras_process_image(image)
    print("processed: " + str(processed.shape))
    pred_probab = model.predict(processed)[0]
    pred_class = list(pred_probab).index(max(pred_probab))
    return max(pred_probab), pred_class


def keras_process_image(img):
    image_x = 28
    image_y = 28
    img = cv2.resize(img, (image_x, image_y))
    img = np.array(img, dtype=np.float32)
    img = np.reshape(img, (-1, image_x, image_y, 1))
    return img

def b64_to_numpy(dat):
    import base64
    dat = dat.strip('data:image/png;base64')
    dat = dat.strip(',')
    # https://stackoverflow.com/questions/49511753/python-byte-image-to-numpy-array-using-opencv
    image_bytes = base64.b64decode(dat)
    decoded = cv2.imdecode(np.frombuffer(image_bytes, np.uint8), -1)
    return decoded


