# Processing from: https://github.com/akshaybahadur21/QuickDraw
def preprocess(unprocessed):
    processed = unprocessed
    unprocessed_gray = cv2.cvtColor(unprocessed, cv2.COLOR_BGR2GRAY)
    # unprocessed_gray = unprocessed
    blur1 = cv2.medianBlur(unprocessed_gray, 15)
    blur1 = cv2.GaussianBlur(blur1, (5, 5), 0)
    thresh1 = cv2.threshold(blur1, 0, 255, cv2.THRESH_BINARY + cv2.THRESH_OTSU)[1]
    blackboard_cnts = cv2.findContours(thresh1.copy(), cv2.RETR_TREE, cv2.CHAIN_APPROX_NONE)[0]
    if len(blackboard_cnts) >= 1:
        cnt = max(blackboard_cnts, key=cv2.contourArea)
        print(cv2.contourArea(cnt))
        if cv2.contourArea(cnt) > 2000:
            x, y, w, h = cv2.boundingRect(cnt)
            processed = unprocessed_gray[y:y + h, x:x + w]
    return processed


classes = ["apple", "bowtie", "candle"]
def make_prediction(data):
    unprocessed = b64_to_numpy(data)
    processed = preprocess(unprocessed)
    pred_probab, pred_class = keras_predict(model, processed)
    print(pred_probab, pred_class)




